import java.util.Scanner;

class StackSample{
    public static void main(String[] args) {
        int type_of_op; 
        MyStack obj = new MyStack();
        Scanner s = new Scanner(System.in);

        while(true){
            System.out.println("\nStack Operations");
            System.out.println("[1] - PUSH");
            System.out.println("[2] - POP");
            System.out.println("[3] - PRINT");
            System.out.println("[4] - TOP");
            System.out.println("[0] - EXIT");
            System.out.print("Enter your choice: ");
            type_of_op = s.nextInt();
            switch(type_of_op){
                case 1:
                    System.out.print("\nEnter the element to be pushed: ");
                    obj.push(s.nextInt());
                    break;
                case 2:
                    System.out.println("\nThe element you popped is " + obj.pop());
                    break;
                case 3:
                    System.out.println("\nStack elements are: ");
                    obj.print();
                    break;
                case 4:
                    obj.top();
                    break;
                case 0:
                    System.out.println("\nExiting...");
                    s.close(); //close scanner
                    return;
                default:
                    System.out.println("Unrecognized Choice. Try again.");
                    break;
            }
        }
    }
}

class MyStack{
    int st_element[] = new int[10]; //stack of size 10
    int tos; //top of stack

    MyStack(){
        tos = -1; //empty stack
    }

    public boolean empty_stack(){ //check if stack is empty
        if (tos == -1){
            return true;
        } else
        return false;
    }

    public boolean full_stack(){ //check if stack is full
        if (tos == 10){
            return true;
        } else
        return false;
    }

    public void push(int item){ //push element
        if(full_stack()){
            System.out.println("\nCannot push. Stack is full");
        }else{
            st_element[++tos] = item;
        }
    }

    public int pop(){ //pop element
        if(tos<0){
            System.out.println("\nThe stack has no elements");
            return 0;
        } else {
            return st_element[tos--];
        }
    }

    public void print(){ //print stack
        int temp = 0;
        if(!empty_stack()){
            temp = pop();
            System.out.println(temp);
            print();
            push(temp);
        }
    }

    public void top(){ //print top of stack
        if(!empty_stack()){
            System.out.println("\nThe top of the element is: " + st_element[tos]);
        } else {
            System.out.println("The stack has no elements");
        }
    }
}

