public class VarrockEssenceMiner extends IdleScript {

  boolean waitForTele;
  long startWaitTele;

  public int start(String[] parameters) {
    while (controller.isRunning()) {
      controller.sleep(loop());
    }
    return 1;
  }

  private int loop() {
    if (controller.isCurrentlyWalking() || controller.isBatching()) {
      return 500;
    }
    if (waitForTele && !inEssenceMine() && System.currentTimeMillis() - startWaitTele < 5000) {
      return 1000;
    }
    waitForTele = false;
    if (controller.getInventoryItemCount() < 30) {
      if (!inEssenceMine()) {
        if (controller.getNearestNpcById(54, false) == null) {
          controller.setStatus("@red@Walking to Aburey");
          controller.walkTo(104, 524);
          return 500;
        }
        controller.setStatus("@red@Teleporting");
        controller.npcCommand1(controller.getNearestNpcById(54, false).serverIndex);
        waitForTele = true;
        startWaitTele = System.currentTimeMillis();
        return 500;
      }
      controller.setStatus("@red@Mining");
      controller.atObject(691, 2);
      return 500;
    }
    if (inEssenceMine()) {
      controller.setStatus("@red@Leave Mine");
      controller.atObject(685, 14);
      return 500;
    }
    if ((controller.getNearestNpcById(95, false) == null)) {
      controller.setStatus("@red@Walking to Bank");
      controller.walkTo(103, 512);
      return 500;
    }
    if (!controller.isInBank()) {
      controller.setStatus("@red@Opening Bank");
      controller.npcCommand1(controller.getNearestNpcById(95, false).serverIndex);
      return 500;
    }
    controller.depositItem(1299, 30);
    controller.setStatus("@red@Depositing");
    return 500;
  }

  private boolean inEssenceMine() {
    return controller.currentY() <= 100;
  }
}

