  }

  map<vector<int>, int> dist;
  queue<vector<int>> q;
  q.push(a);
  dist[a] = 0;

  auto eq = [](vector<int> &a, vector<int> &b) {
    if (a.size() != b.size()) return false;
    for (int i = 0; i < (int)a.size(); ++i) {
      if (a[i] != b[i]) return false;
    }
    return true;
