          dist[v] = dist[u] + 1;
          q.push(v);
        }
      } else {
        // pinned
        vector<int> v;
        bool ok = false;
        for (int j = 0; j < n; ++j) if (i != j) {
          if (u[j] > 0 and !ok) {
            v.push_back(-u[i]);
