from typing import Container, Iterable
import string
import re


def normalize_word(word: str) -> str:
    """
    ÐÐ¾ÑÐ¼Ð°Ð»Ð¸Ð·ÑÐµÑ ÑÑÑÐ¾ÐºÑ Ðº ÐµÐ´Ð¸Ð½Ð¾Ð¼Ñ ÑÐ¾ÑÐ¼Ð°ÑÑ.
    note: Ð¸ÑÐ¿Ð¾Ð»ÑÐ·ÑÑ next(..., ''), ÑÑÐ¾Ð±Ñ ÑÑÐ½ÐºÑÐ¸Ñ Ð½Ðµ ÑÐ°Ð¹Ð·Ð¸Ð»Ð° IndexError
    """
    return next(re.findall('[a-zA-Z]+', word.lower()), '')


def check_word(word: str, dictionary: Container[str]) -> bool:
    """ÐÑÐ¾Ð²ÐµÑÐºÐ°, ÑÑÐ¾ ÑÐ»Ð¾Ð²Ð¾ Ð¿ÑÐ¸Ð½Ð°Ð´Ð»ÐµÐ¶Ð¸Ñ ÑÐ»Ð¾Ð²Ð°ÑÑ"""
    normalized_word = normalize_word(word)
    return normalized_word in dictionary


def create_dictionary(words: Iterable[str]) -> Container[str]:
    """Ð¡Ð¾Ð·Ð´Ð°ÐµÑ ÑÐ»Ð¾Ð²Ð°ÑÑ Ð½Ð° Ð¾ÑÐ½Ð¾Ð²Ðµ ÑÐ»Ð¾Ð², Ð¿ÑÐ¸ÑÐµÐ´ÑÐ¸Ñ Ð½Ð° Ð²ÑÐ¾Ð´"""
    return set(map(normalize_word, words))


def tokenize_text(text: str):
    """
    Ð¢Ð¾ÐºÐµÐ½Ð¸Ð·Ð¸ÑÑÐµÑ ÑÐµÐºÑÑ. ÐÑÐ¶Ð½Ð¾ Ð±ÑÐ»Ð¾ Ñ ÑÐ¾Ð¹ ÑÐµÐ»ÑÑ, ÑÑÐ¾Ð±Ñ Ð¸Ð·Ð±Ð°Ð²Ð¸ÑÑÑÑ Ð¾Ñ Ð»Ð¸ÑÐ½Ð¸Ñ
    Ð´ÐµÑÐ°Ð»ÐµÐ¹ Ð² ÑÐµÐºÑÑÐµ: Ðº Ð¿ÑÐ¸Ð¼ÐµÑÑ, Ð¸Ð·Ð»Ð¸ÑÐ½ÑÑ Ð²Ð°ÑÐ¸Ð°ÑÐ¸Ñ "Ð½ÐµÐ½ÑÐ¶Ð½ÑÑ" ÑÐ¸Ð¼Ð²Ð¾Ð»Ð¾Ð² ',', '.' Ð¸ Ñ.Ð´.
    
    Ð¢Ð¾ÐºÐµÐ½ Ð¼Ð¾Ð¶ÐµÑ Ð±ÑÑÑ Ð´Ð²ÑÑ ÑÐ¸Ð¿Ð¾Ð²:
    1. word - Ð¾Ð¿Ð¸ÑÑÐ²Ð°ÐµÑ Ð½ÐµÐºÐ¾ÑÐ¾ÑÐ¾Ðµ ÑÐ»Ð¾Ð²Ð¾ Ð² ÑÐµÐºÑÑÐµ. ÐÑÐµÐ´ÑÑÐ°Ð²Ð»ÐµÐ½ ÐºÐ°Ðº ['word', <word-value>]
    2. separator - Ð¾Ð¿Ð¸ÑÑÐ²Ð°ÐµÑ Ð¿Ð¾Ð´ÑÑÑÐ¾ÐºÑ, ÐºÐ¾ÑÐ¾ÑÐ°Ñ ÑÐ²Ð»ÑÐµÑÑÑ ÑÐ°Ð·Ð´ÐµÐ»Ð¸ÑÐµÐ»ÐµÐ¼ Ð¼ÐµÐ¶Ð´Ñ ÑÐ»Ð¾Ð²Ð°Ð¼Ð¸.
    ÐÑÐµÐ´ÑÑÐ°Ð²Ð»ÐµÐ½ ÐºÐ°Ðº ['separator', <separator-chars-amount>]
    """
    
    tokens = [['separator', 0]]

    for char in text:
        if char in string.ascii_letters:
            if tokens[-1][0] == 'word':
                tokens[-1][1] += char
            else:
                tokens.append(['word', char])
        else:
            if tokens[-1][0] == 'separator':
                tokens[-1][1] += 1
            else:
                tokens.append(['separator', 1])

    return tokens


def check_text(tokens, dictionary):
    """
    ÐÑÐ¾Ð²ÐµÑÐºÐ° Ð²ÑÐµÐ³Ð¾ ÑÐµÐºÑÑÐ° Ð½Ð° Ð¾ÑÑÐ¾Ð³ÑÐ°ÑÐ¸Ñ. ÐÐ° Ð²ÑÐ¾Ð´ Ð¿ÑÐ¸ÑÐ¾Ð´ÑÑ ÑÐ¾ÐºÐµÐ½Ñ, Ð½Ð° ÐºÐ¾ÑÐ¾ÑÑÐµ Ð±ÑÐ»
    ÑÐ°Ð·Ð±Ð¸Ñ ÑÐµÐºÑÑ, Ð¸ ÑÐ»Ð¾Ð²Ð°ÑÑ.
    
    ÐÐ¾Ð·Ð²ÑÐ°ÑÐ°ÐµÐ¼Ð¾Ðµ Ð·Ð½Ð°ÑÐµÐ½Ð¸Ðµ - ÑÐ¿Ð¸ÑÐ¾Ðº, ÑÐ¾ÑÑÐ¾ÑÑÐ¸Ð¹ Ð¸Ð· Ð±Ð»Ð¾ÐºÐ¾Ð² Ñ ÑÐµÐ·ÑÐ»ÑÑÐ°ÑÐ°Ð¼Ð¸ Ð¿ÑÐ¾Ð²ÐµÑÐºÐ¸.
    ÐÐ°Ð¶Ð´ÑÐ¹ Ð±Ð»Ð¾Ðº ÑÐ¾ÑÑÐ¾Ð¸Ñ Ð¸Ð· Ð´Ð²ÑÑ ÑÐ»ÐµÐ¼ÐµÐ½ÑÐ¾Ð²:
    1. Ð ÐµÐ·ÑÐ»ÑÑÐ°Ñ Ð¿ÑÐ¾Ð²ÐµÑÐºÐ¸
    2. ÐÐ¾Ð»Ð¸ÑÐµÑÑÐ²Ð¾ ÑÐ¸Ð¼Ð²Ð¾Ð»Ð¾Ð², ÐºÐ¾ÑÐ¾ÑÑÐµ Ð±ÑÐ»Ð¸ Ð¿ÑÐ¾Ð²ÐµÑÐµÐ½Ñ
    """
    
    checked = []

    for token_type, token_value in tokens:
        if token_type == 'word':
            check_result = check_word(token_value, dictionary)
            checked.append((check_result, len(token_value)))
        else:
            checked.append((True, token_value))

    return checked


def render_check_result(result):
    """Ð ÐµÐ¿ÑÐµÐ·ÐµÐ½ÑÐ°ÑÐ¸Ñ ÑÐµÐ·ÑÐ»ÑÑÐ°ÑÐ¾Ð² Ð¿ÑÐ¾Ð²ÐµÑÐºÐ¸ Ð² ÑÐ¾ÑÐ¼Ð°Ñ, ÑÑÐµÐ±ÑÑÑÐ¸Ð¹ÑÑ Ð² Ð·Ð°Ð´Ð°Ð½Ð¸Ð¸"""
    repr_symbols = ['~', '.']
    return ''.join(repr_symbols[is_correct] * length for is_correct, length in result)


